/* This file is used for the navigation bar at the top. */

import React from 'react';
import {
    StyleSheet,
    View,
    TouchableOpacity,
    Text,
    Pressable,
    Dimensions
  } from "react-native";
  
  const windowWidth = Dimensions.get("window").width;
  
  const styles = StyleSheet.create({
    container: {
      alignSelf: "stretch",
      width: windowWidth,
      height: 100,
      backgroundColor: "white",
      color: "red",
      alignItems: "center",
      justifyContent: "space-between",
      flexDirection: "row"
    },
    button: {
      alignItems: "center",
      justifyContent: "center",
      paddingVertical: 10,
      paddingHorizontal: 20,
      borderRadius: 20,
      backgroundColor: "white",
      borderStyle: "solid"
    },
    text: {
      fontSize: 16,
      fontWeight: "bold",
      color: "blue"
    }
  });
  
  function TopBar() {
    return (
      <View style={styles.container}>
        <TouchableOpacity>
          <View style={styles.button}>
            <Text style={styles.text}>Home</Text>
          </View>
        </TouchableOpacity>
        {/* <Pressable style={styles.button} title="Home"/>
              <Pressable style={styles.button} title="Courses"/>
              <Pressable style={styles.button} title="Projects"/>
              <Pressable style={styles.button} title="Skills"/>
              <Pressable style={styles.button} title="Education"/>
              <Pressable style={styles.button} title="Contact"/> */}
      </View>
    );
  }
  
  export default TopBar;
